subSection.paragraph:
A morphological data matrix was constructed in Microsoft Excel (Appendix 2), and imported into PATN version 3.12 (Blatant Fabrications Pty Ltd) for cluster and ordination analysis appropriate to address the current taxonomic question (cf.
Wills et al . 2000
;
Plunkett et al. 2009
). A total of 74 specimens (Appendix 1) were used with 25 characters, 14 of which were quantitative, seven multistate and four binary characters were equally weighted and range-standardised. The distance matrix was produced using the Gower metric association measure. Three-dimensional ordination plots were generated using Semi-Strong Hybrid Multi-Dimensional Scaling (SSH MDS) with 200 random starts and 500 iterations to minimise the stress value. Phenograms were generated using Flexible UPGMA with β= -0.1. Correlation of characters with the ordination pattern (PCC) are presented for all characters.

